"use strict";(globalThis.webpackChunkmy_website=globalThis.webpackChunkmy_website||[]).push([[1521],{6302(e){e.exports=JSON.parse('{"tag":{"label":"Grasp","permalink":"/docs/tags/grasp","allTagsPath":"/docs/tags","count":10,"items":[{"id":"oop/GRASP/controller","title":"Controller","description":"The controller pattern assigns the responsibility of dealing with system events to a non-UI class that represents the overall system or a use case scenario. A controller object is a non-user interface object responsible for receiving or handling a system event.","permalink":"/docs/oop/GRASP/controller"},{"id":"oop/GRASP/creator","title":"Creator","description":"Who creates an Object? Or who should create a new instance of some class?","permalink":"/docs/oop/GRASP/creator"},{"id":"oop/GRASP/high-cohesion","title":"High cohesion","description":"High cohesion is an evaluative pattern that attempts to keep objects appropriately focused, manageable and understandable","permalink":"/docs/oop/GRASP/high-cohesion"},{"id":"oop/GRASP/indirection","title":"Indirection","description":"The indirection pattern supports low coupling (and reuse potential) between two elements by assigning the responsibility of mediation between them to an intermediate object.","permalink":"/docs/oop/GRASP/indirection"},{"id":"oop/GRASP/information-expert","title":"Information expert","description":"Information expert (also expert or the expert principle) is a principle used to determine where to delegate responsibilities such as methods, computed fields, and so on.","permalink":"/docs/oop/GRASP/information-expert"},{"id":"oop/GRASP/intro","title":"Intro","description":"Guides in assigning responsibilities to collaborate objects","permalink":"/docs/oop/GRASP/intro"},{"id":"oop/GRASP/low-coupling","title":"Low coupling","description":"Coupling is a measure of how strongly one element is connected to/has knowledge of/or relies on other elements.","permalink":"/docs/oop/GRASP/low-coupling"},{"id":"oop/GRASP/polymorphism","title":"Polymorphism","description":"Responsibility for defining the variation of behaviors based on type is assigned to the type for which this variation happens","permalink":"/docs/oop/GRASP/polymorphism"},{"id":"oop/GRASP/protected-varioations","title":"Protected variations","description":"The protected variations pattern protects elements from the variations on other elements (objects, systems, subsystems) by wrapping the focus of instability with an interface and using polymorphism to create various implementations of this interface.","permalink":"/docs/oop/GRASP/protected-varioations"},{"id":"oop/GRASP/pure-fabrication","title":"Pure fabrication","description":"A pure fabrication is a class that does not represent a concept in the problem domain, specially made up to achieve low coupling, high cohesion, and the reuse potential thereof derived (when a solution presented by the information expert pattern does not)","permalink":"/docs/oop/GRASP/pure-fabrication"}],"unlisted":false}}')}}]);